import React from 'react';
export default () => {
  const comparisonColdef = [
    {
      Header: 'Scenario',
      accessor: 'store_code',
    },
    {
      Header: 'Sell Through %',
      accessor: 'store_name',
    },
    {
      Header: 'Margin %',
      accessor: 'chain_description',
    },
    {
      Header: 'AUR ($)',
      accessor: 'region_description',
    },
  ];
  return comparisonColdef;
};
